import React, { Component, Suspense } from 'react';
import { Route, Switch, Redirect } from 'react-router-dom';
import Header from '../Layout/Header'
import Copyright from '../Layout/Copyright'
import Footer from '../Layout/Footer'
import Clientlogo from '../Layout/Clientlogo';
import News from '../Layout/News';
import Shopbanner from '../Layout/Shopbanner';
import Advertisement from '../Layout/Advertisement';
import Testimonial from '../Layout/Testimonial';
import Cartbanner from '../Layout/Cartbanner';
import Product from '../Layout/Product';
import Features from '../Layout/Features';
import Hero from '../Layout/Hero';
import Featured from '../Layout/Featured';
import Team from '../Layout/Team';

export class Career extends Component {
    render() {
        return (
            <div>
                <Header />
                <div className="breadcrumb-section breadcrumb-bg">
                    <div className="container">
                        <div className="row">
                            <div className="col-lg-8 offset-lg-2 text-center">
                                <div className="breadcrumb-text">
                                    <p>Boost your Career</p>
                                    <h1>Hiring is on!</h1>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="billing-address-form">
                    <form action="index.html">
                        <p><input type="text" placeholder="What are you looking for?" /></p>
                        <p><select><option>Mumbai</option><option>Ratlam</option></select></p>
                        <p><input type="text" placeholder="Address" /></p>
                        <p><input type="tel" placeholder="Phone" /></p>
                        <p><textarea name="bill" id="bill" cols="30" rows="10" placeholder="Say Something"></textarea></p>
                    </form>
                </div>
                <Featured />
                <Shopbanner />
                <Team />
                <Testimonial />
                <Clientlogo />
                <Footer />
                <Copyright />
            </div >
        )
    }
}
export default Career
